import React from 'react';

function Button(props){
  return (
    <button type="submit">
    Search
    </button>

  )
}

function Input(props){
    return (
      <input
        type="text"
        onChange={props.onUpdateWord}
        value={props.meta}
      />
    )
  }

 const Search = (props) => {
  return (
    <form onSubmit={props.onSubmitWord}>
    <div>
      <Input  onUpdateWord={props.onUpdateWord} word={props.meta}/>
      <Button />
    </div>
    </form>
  );
}

export default Search;
